import React, { Component } from 'react';
import Logo from '../logo/Logo';
import './userpage.css'

class UserPage extends Component{
	render(){
		return(
			<div className = 'user'>
			<div>
			<Logo />
			</div>
			</div>
			);
	}
}
export default UserPage;
